import React, { Component } from 'react'

export default class Timer extends Component {
  
  render() {
    const { hideTimer } = this.state;
    return (
      <div className={hideTimer ? '.d-none' : ''}>
        <h4>{props.timer}</h4>
        <div>
          Too much pressure ? <br />
          <button className="btn btn-dark btn-sm mr-auto" onClick={props.onToggleTimerClick}>Hide Timer</button>
        </div>
      </div>
    )
  }
}
